import React from 'react'

class User extends React.Component {
	constructor() {
		super();
	}

	render() {
		return <div>
			<p>{this.props.name + ' ' + this.props.surname}</p>
            <button onClick={this.props.deleteItem.bind(null, this.props.num)}>Удалить</button>
		</div>;
	}
}


export default User;
